int main() {
    int n, m;
    scanf("%d %d", &n, &m);

    // Create an array of rooms
    Room* rooms = (Room*)malloc(n * sizeof(Room));
    for (int i = 0; i < n; i++) {
        rooms[i] = *createRoom();
    }

    // Read door information
    Door door;
    for (int i = 0; i < m; i++) {
        scanf("%d %d %d", &door.room1, &door.room2, &door.direction);
        addDoor(&rooms[door.room1 - 1], door);
        if (door.direction == 2) {
            addDoor(&rooms[door.room2 - 1], door);
        }
    }

    // Initialize visited array
    int* visited = (int*)calloc(n, sizeof(int));

    int max_time = 0;
    // Perform DFS from each room
    for (int i = 0; i < n; i++) {
        if (!visited[i]) {
            int time = dfs(rooms, i, visited, 0);
            max_time = (time > max_time) ? time : max_time;
        }
    }

    // Check if George can escape forever
    for (int i = 0; i < n; i++) {
        if (rooms[i].doors_count > 1) {
            max_time = INT_MAX;
            break;
        }
    }

    // Print the result
    if (max_time == INT_MAX) {
        printf("Infinite\n");
    } else {
        printf("%d\n", max_time);
    }

    // Free allocated memory
    free(rooms);
    free(visited);

    return 0;
}
